description:
Episode Title: &quot;Friendship Fiasco!; Car Custody Triangle&quot;
Episode Order: Season 18, Episode 260
Original Air Date: July 04, 2014

&quot;A disabled man sues an erstwhile friend for a mortgage loan and the cost of a vacation; a man demands his personal belongings and the return of car payments from his mom and her boyfriend.&quot;

And with that, season 18 concludes. Judge Judy returns with season 19's inaugural episode sometime in early September, probably the 8th. I, of course, will be there to continue posting episodes. Until then, though, I shall enjoy the break. I will, however, continue to provide episodes from season 14 and 15 as I get ahold of them. Adjourned!

Seed and enjoy!
